import React, { Component } from 'react';

export default class WhatIsLibertySoil extends Component {
  constructor (props) {
    super(props);

    this.state = {
      activeSlide: 0
    };
  }

  changeSlide (slideId) {
    this.setState({
      activeSlide: slideId
    });
  };

  render () {
    var activeSlide = this.state.activeSlide;
    var navigation;

    switch (activeSlide) {
      case 0:
        navigation = <p><span className="highlight">Collect and organise resources</span> and <span className="link" onClick={this.changeSlide.bind(this, 1)}>professional social network</span></p>;
        break;

      case 1:
        navigation = <p><span className="link" onClick={this.changeSlide.bind(this, 0)}>Knowledge base</span> and <span className="highlight">professional social network</span></p>;
        break;
    }

    return (<div>
        <section className="landing">
          <header className="landing__header">
            <h2 className="landing__title">You can help more children reach better education</h2>
            {navigation}
          </header>
        </section>
        <div className="page__body page__body-rows">
          <div className="layout__grid_wrapper">
            {activeSlide == 0 && <div className="layout layout-align_center layout-align_vertical layout__grid layout__grid-responsive">
              <div className="layout__grid_item layout__grid_item-identical">
                <div className="void content">
                  <p>LibertySoil lets you collect all types of useful content around web about freedom based education in one place</p>
                  <p><a href="#">Start your collection</a></p>
                </div>
              </div>
              <div className="layout__grid_item layout__grid_item-identical">
                <div className="void">
                  <img className="img" src="data:image/png;base64,"/>
                </div>
              </div>
            </div>}
            {activeSlide == 1 && <div className="layout layout-align_center layout-align_vertical layout__grid layout__grid-responsive">
              <div className="layout__grid_item layout__grid_item-identical">
                <div className="void content">
                  <p>Follow top professionals in education and learn about ideas they have to share.</p>
                  <p><a href="#">Create profile</a></p>
                </div>
              </div>
              <div className="layout__grid_item layout__grid_item-identical">
                <div className="void">
                  <img className="img" src="data:image/png;base64,"/>
                </div>
              </div>
            </div>}
          </div>
        </div>
    </div>)
  }
}
